import React from 'react';
import './NewsCard.css';

function NewsCard() {
    return (
        <ul className="cards__container">
            <li className="card__item">
                <img src={author} className="about__author-img" alt="Изображение автора" />
            </li>
        </ul>
    )
}

export default NewsCard;
